import React from "react";
import { nproducts }  from "./nproducts";
import { Row, Col, Container } from "react-bootstrap";
import { Novicedetails } from "./Novicedetails";

export const Novice = () => {
  return (
    
      <Container>
        <div>
        <Row>
          {nproducts.map((nproduct) => (
            <Col md={3}>
              <Novicedetails nproduct={nproduct} />
            </Col>
          ))}
        </Row>
      </div>
      </Container>
  );
};
